import { useState, useEffect } from "react";
import { Card, Button } from "react-bootstrap";
import axios from "axios";

export default function PtofilePage() {
  const [userData, setUserData] = useState([]);

  useEffect(() => {
    getdata();
  }, []);

  const getdata = () => {
    let url = "http://localhost:4000/profile";
    axios.get(url).then(function (res) {
      setUserData(res.data.message);
    });
  };

  return (
    <>
      <Card style={{ width: "30rem", height: "15rem", margin: "10rem" }}>
        <Card.Body>
          <Card.Title className="mb-4">User Profile</Card.Title>
          <Card.Text>Name : Hitesh Prajapati</Card.Text>
          <Card.Text>Number : 456464</Card.Text>
          <Card.Text>Email : Hitesh@mail.com</Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
    </>
  );
}
